import React, { useEffect, useState } from 'react';
import { useNavigate } from 'react-router-dom';
import { Bar } from 'react-chartjs-2';
import { Chart, CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend } from 'chart.js';

Chart.register(CategoryScale, LinearScale, BarElement, Title, Tooltip, Legend);

function Dashboard() {
  const [commissionData, setCommissionData] = useState(null);
  const [violationsData, setViolationsData] = useState(null);
  const [commissionHistory, setCommissionHistory] = useState([]);
  const [weeklyCommissions, setWeeklyCommissions] = useState([]);
  const [showDetails, setShowDetails] = useState(false);
  const [showQualifications, setShowQualifications] = useState(false);
  const [chartFilter, setChartFilter] = useState('Weekly');
  const navigate = useNavigate();

  useEffect(() => {
    const userEmail = localStorage.getItem('userEmail');
    if (!userEmail) {
      navigate('/');
      return;
    }

    const fetchData = async () => {
      const response = await fetch(`https://us-central1-optimal-comfort-464220-t1.cloudfunctions.net/loginHandler?email=${userEmail}`);
      const result = await response.json();
      if (result.success) {
        setCommissionData(result.commissionData);
        setViolationsData(result.violationsData);
        setCommissionHistory(result.commissionHistory || []);
        setWeeklyCommissions(result.weeklyCommission || []);
      } else {
        alert("Failed to fetch data");
      }
    };

    fetchData();
  }, [navigate]);

  const handleLogout = () => {
    localStorage.removeItem('userEmail');
    navigate('/');
  };

  if (!commissionData || !violationsData) return <div>Loading...</div>;

  const agentFirstName = commissionData.agentname ? commissionData.agentname.split(" ")[0] : "Agent";
  const weekStart = commissionData.week_start_date || "N/A";
  const weekEnd = commissionData.week_end_date || "N/A";

  // ✅ Prepare top 5 bonuses for this week
  const top5Bonuses = [...weeklyCommissions]
    .filter(item => item.totalbonus)
    .map(item => ({
      name: item.agentname,
      bonus: parseFloat(item.totalbonus.toString().replace(/[$,]/g, '')) || 0
    }))
    .sort((a, b) => b.bonus - a.bonus)
    .slice(0, 5);

  // ✅ Calculate total commission YTD
  const totalYTD = commissionHistory.reduce((acc, item) => {
    const val = item.commissionafterarfeescanningviolations;
    return acc + (typeof val === "string" ? parseFloat(val.replace(/[$,]/g, '')) || 0 : val || 0);
  }, 0).toLocaleString('en-US', { style: 'currency', currency: 'USD' });

  // ✅ Prepare commission history chart data
  const filteredHistory = commissionHistory.filter(item => {
    if (chartFilter === 'Monthly') {
      return item.commissionweek && item.commissionweek.includes('Jun');
    } else if (chartFilter === 'YTD') {
      return true;
    } else {
      return true;
    }
  });

  const chartLabels = filteredHistory.map(item => item.commissionweek || 'N/A');
  const chartValues = filteredHistory.map(item => {
    const value = item["commissionafterarfeescanningviolations"];
    return typeof value === "string" ? parseFloat(value.replace(/[$,]/g, '')) || 0 : value || 0;
  });

  const commissionChartData = {
    labels: chartLabels,
    datasets: [
      {
        label: 'Commission ($)',
        data: chartValues,
        backgroundColor: '#d32f2f',
      }
    ],
  };

  return (
    <div style={{ fontFamily: "Arial, sans-serif", backgroundColor: "#f9f9f9", minHeight: "100vh" }}>
      {/* 🔴 Header */}
      <div style={{ backgroundColor: "#d32f2f", color: "#fff", display: "flex", alignItems: "center", justifyContent: "space-between", padding: "10px 20px" }}>
        <div style={{ display: "flex", alignItems: "center" }}>
          <img src="/fiesta-logo.png" alt="Fiesta Logo" style={{ height: "40px", marginRight: "10px" }} />
          <div>
            <h1 style={{ margin: 0 }}>Welcome, {agentFirstName}</h1>
          </div>
        </div>
        <button onClick={handleLogout} style={{ backgroundColor: "#fff", color: "#d32f2f", border: "none", padding: "5px 10px", cursor: "pointer", borderRadius: "3px" }}>Logout</button>
      </div>

      {/* 🏆 Top 5 bonuses + YTD summary */}
      <div style={{ display: "flex", justifyContent: "space-between", backgroundColor: "#fff", padding: "10px 20px", borderBottom: "1px solid #ddd" }}>
        <div>
          <strong>🏆 Top 5 Bonuses This Week:</strong>
          <ul style={{ margin: 0, paddingLeft: "20px" }}>
            {top5Bonuses.map((item, index) => (
              <li key={index}>{item.name}: ${item.bonus.toLocaleString()}</li>
            ))}
          </ul>
        </div>
        <div>
          <strong>Total Commission YTD:</strong>
          <div>{totalYTD}</div>
        </div>
      </div>

      {/* 📊 Weekly + History side by side */}
      <div style={{ display: "flex", flexWrap: "wrap" }}>
        {/* 📝 Weekly Commission */}
        <div style={{ flex: "1", minWidth: "400px", margin: "20px" }}>
          <div style={{ backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            Weekly Commission | {weekStart} - {weekEnd}
          </div>
          <div style={{ backgroundColor: "#fff", padding: "10px", border: "1px solid #ddd", borderTop: "none", borderRadius: "0 0 5px 5px" }}>
            <p><strong>NB BF:</strong> {commissionData.nbrwbf}</p>
            <p><strong>Endo Fees:</strong> {commissionData.enfees}</p>
            <p><strong>NB+EN Total:</strong> {commissionData.totalnben}</p>
            <p style={{ fontWeight: "bold", color: "#d32f2f" }}>Expenses</p>
            <p><strong>Gross Pay:</strong> {commissionData.grosspay}</p>
            <p><strong>Total NBs:</strong> {commissionData.totalnbs}</p>
            <p><strong>NB Corp Fees:</strong> {commissionData.nbcorffee}</p>
            <p><strong>Endo Corp Fees:</strong> {commissionData.encorpfee}</p>
            <p><strong>Referrals/Pay Out:</strong> {commissionData.refferalspayout}</p>
            <p><strong>Total Rev After Fees *:</strong> {commissionData["nben(afterfees)"]}</p>
            <p style={{ fontSize: "12px", color: "#555" }}>* must be $500 or more in Total Rev After Fees to qualify for COMMISSION.</p>
            <p><strong>Reinstatement and Renewal Fees:</strong> {commissionData.reissuerenewaltotal}</p>
            <p><strong>Bonus Tier:</strong> {commissionData.bonustier === "Not Met" ? <span style={{ color: "red" }}>❌ {commissionData.bonustier}</span> : <span style={{ color: "green" }}>✅ {commissionData.bonustier}</span>}</p>
            <p><strong>Bonus:</strong> {commissionData.totalbonus}</p>
            <p><strong>Total Violations:</strong> {commissionData.totalviolations}</p>
            <p><strong>Total Commission:</strong> {commissionData.commissionafterarfeescanningviolations}</p>
          </div>
        </div>

        {/* 📈 Commission History Chart */}
        <div style={{ flex: "1", minWidth: "400px", margin: "20px" }}>
          <div style={{ display: "flex", alignItems: "center", justifyContent: "space-between", backgroundColor: "#d32f2f", color: "#fff", padding: "10px", fontWeight: "bold", borderRadius: "5px 5px 0 0" }}>
            <span>📈 Commission History</span>
            <select value={chartFilter} onChange={(e) => setChartFilter(e.target.value)} style={{ backgroundColor: "#fff", color: "#d32f2f", border: "none", padding: "5px", borderRadius: "3px", fontWeight: "bold" }}>
              <option value="Weekly">Weekly</option>
              <option value="Monthly">Monthly</option>
              <option value="YTD">Year to Date</option>
            </select>
          </div>
          <div style={{ backgroundColor: "#fff", padding: "10px", border: "1px solid #ddd", borderTop: "none", borderRadius: "0 0 5px 5px" }}>
            <Bar data={commissionChartData} options={{ responsive: true, plugins: { legend: { display: false }, title: { display: true, text: 'Commission History' } } }} />
          </div>
        </div>
      </div>
    </div>
  );
}

export default Dashboard;
